import {$authHost, $host} from "./index";
import jwt_decode from "jwt-decode";

export const createPrintTechnology = async (printTechnology) => {
    const {data} = await $authHost.post('api/print_technology', { print_technology: printTechnology })
    return data
}

export const fetchPrint_Technologys = async () => {
    const {data} = await $host.get('api/print_technology')
    return data
}

export const createBrand = async (brand) => {
    const {data} = await $authHost.post('api/brand', brand)
    return data
}

export const fetchBrands = async () => {
    const {data} = await $host.get('api/brand', )
    return data
}

export const createPrinter = async (printer) => {
    const {data} = await $authHost.post('api/printer', printer)
    return data
}

export const fetchPrinters = async (print_technologyId, brandId, page, limit= 5) => {
    const {data} = await $host.get('api/printer', {params: {
            print_technologyId, brandId, page, limit
        }})
    return data
}

export const fetchOnePrinter = async (id) => {
    const {data} = await $host.get('api/printer/' + id)
    return data
}
